import React from "react";

function ShowMenu(){
    const hamburguerButton = document.querySelector('.navbar-icon')
const mobileMenu = document.querySelector('.mobile-nav')

    hamburguerButton.addEventListener('click', function(){
        mobileMenu.classList.toggle('is-active')
    })
}

function MobileMenu(){
    return(
        <nav className="mobile-nav">
            <a href="#home">Home</a>
            <a href="#project-title">Projetos</a>
            <a href="#skills">Skills</a>
            <a href="https://www.figma.com/file/wTh2kmW18ywNQQDIWPKDf9/Portf%C3%B3lio?node-id=13%3A24" target="_blank">Figma</a> 
            <a href="https://github.com/wpcavalcante" target="_blank">GitHub</a>
        </nav>
    )
}

export default MobileMenu
